package android.com.base

import android.com.base.http.*
import android.com.base.image.FrescoProxy
import android.com.base.image.GlideProxy
import android.com.base.image.ImageProxy
import android.content.Intent
import android.graphics.Color
import android.os.Bundle
import android.widget.ImageView
import androidx.core.app.ActivityOptionsCompat
import com.facebook.drawee.backends.pipeline.Fresco
import kotlinx.android.synthetic.main.activity_main.*
import kotlinx.coroutines.Dispatchers
import kotlinx.coroutines.launch

class MainActivity : BaseActivity() {

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)

        ImageProxy(GlideProxy())
            .load(
                this,
                "data:image/jpeg;base64,"
            )
            .asRound(12, 1, Color.RED)
            .resize(500, 500)
            .into(transition)
        transition.setOnClickListener {
            val intent = Intent(this@MainActivity, ImageActivity::class.java)
            val toBundle = ActivityOptionsCompat.makeSceneTransitionAnimation(
                this,
                transition,
                "image"
            )
                .toBundle()
            startActivity(intent, toBundle)
        }
        ImageProxy(FrescoProxy())
            .load(
                this,
                "data:image/jpeg;base64,"
            )
            .scaleType(ImageView.ScaleType.CENTER_CROP)
            .asRound(12, 2, Color.RED)
            .resize(500, 500)
            .into(simpleDraweeView)

    }
}
